import './App.css';
import React, { useEffect } from 'react';
import { Route, Routes } from 'react-router-dom';
import {HomePage} from './components/HomePage/HomePage';
import {JourneyTable} from './components/JourneyTable/JourneyTable';
import {StationTable} from './components/StationTable/StationTable';


const App = () => {
  useEffect(()=>{
    fetch('/api/stations/',{
     method:"GET",
     mode: 'no-cors'
    },[])
  .then(res => res.json())
  .then(data => console.log(data))
  .catch(error => console.error(error));
  })

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/journeyTable" element={<JourneyTable />} />    
        <Route path="/stationTable" element={<StationTable />} />
      </Routes>
    </div>
  );
}

export default App;
